import React from 'react';

const Index = () => {
    return (
        <div className="flex flex-wrap items-center justify-start py-10">
            <section className="flex flex-col md:flex-row items-center align-middle py-4 px-4">
                <img src="/img/pfp.png" className="rounded-full shadow-md"></img>
                <h1 className="px-4 text-4xl text-white leading-normal">Hello there, my name is <span className="text-indigo-200 font-bold">Kyu</span></h1>
            </section>
        </div>
    )
}

export default Index;
